import { Route, Routes } from 'react-router-dom';
import GlobalWrapper from './layouts/GlobalWrapper';
import Home from './pages/Home';

function App() {
  return (
    <Routes>

      <GlobalWrapper>

        <Route path='/' element={<Home/>} ></Route>

      </GlobalWrapper>

    </Routes>
  );
}

export default App;
